selector_to_html = {"a[href=\"#referencias\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Referencias<a class=\"headerlink\" href=\"#referencias\" title=\"Link to this heading\">#</a></h2>", "a[href=\"#instalar-distribucion-linux\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Instalar distribuci\u00f3n Linux<a class=\"headerlink\" href=\"#instalar-distribucion-linux\" title=\"Link to this heading\">#</a></h2><p>A trav\u00e9s de la tienda de aplicaciones podemos continuar con la instalaci\u00f3n de\nla distribuci\u00f3n Linux deseada, pero si te interesa continuar con el uso de la\nconsola, procedemos a revisar la direcci\u00f3n de descarga de nuestra distribuci\u00f3n\nacorde a la lista disponible en la secci\u00f3n de descarga manual de la\ndocumentaci\u00f3n oficial <a class=\"reference internal\" href=\"#wsl-manual\" id=\"id4\"><span>[wsl-manual]</span></a>. En nuestro ejemplo, instalaremos Ubuntu\n20.04 (cambiar el n\u00famero de la versi\u00f3n LTS soportada en la URL si te interesa\notra).</p>", "a[href=\"#aplicaciones-graficas\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Aplicaciones gr\u00e1ficas<a class=\"headerlink\" href=\"#aplicaciones-graficas\" title=\"Link to this heading\">#</a></h2><p>Para cerrar este tema, falta que lancemos nuestras aplicaciones gr\u00e1ficas. Para\nesto ser\u00e1 necesario modificar el archivo <code class=\"code docutils literal notranslate\"><span class=\"pre\">.bashrc</span></code> <a class=\"reference internal\" href=\"#ubuntu-wiki\" id=\"id5\"><span>[ubuntu-wiki]</span></a>.</p>", "a[href=\"#errores-comunes\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Errores comunes<a class=\"headerlink\" href=\"#errores-comunes\" title=\"Link to this heading\">#</a></h2><p>Estos errores comunes son basados en lo natural que se ve ir a la tienda de\naplicaciones y escoger instalar nuestra distribuci\u00f3n.</p><p>Al intentar abrir la distribuci\u00f3n de esta manera nos encontraremos con el error\nsiguiente:</p>", "a[href=\"#habilitar-wsl\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Habilitar WSL<a class=\"headerlink\" href=\"#habilitar-wsl\" title=\"Link to this heading\">#</a></h2><p>Nuestro primer paso es abrir la consola de Power Shell en modo administrador y\na continuaci\u00f3n ejecutaremos:</p>", "a[href=\"#usar-ubuntu-en-windows-con-wsl2\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Usar Ubuntu en Windows con WSL2<a class=\"headerlink\" href=\"#usar-ubuntu-en-windows-con-wsl2\" title=\"Link to this heading\">#</a></h1><p>Como contaba en una que otra publicaci\u00f3n, por motivos laborales mantengo mucho\nen Windows pero es necesario en ocasiones tener Linux a la mano. Sin duda a\nnivel de desarrollo Linux toma cada vez mayor relevancia y es notorio cuando\nMicrosoft le da relevancia al soporte de Linux en su ecosistema, no solo en\ndespliegues en nube sino tambi\u00e9n en el mismo escritorio. En esto \u00faltimo,\nreferimos a WSL (<em>Windows Subsystem for Linux</em>) <a class=\"reference internal\" href=\"#wsl\" id=\"id1\"><span>[wsl]</span></a>.</p><p>WSL es el componente de Windows que nos permite cumplir la promesa de este\nart\u00edculo, ejecutar distribuciones Linux desde Windows y con rendimiento alto\n(no se trata de una emulaci\u00f3n sino la ejecuci\u00f3n de un kernel Linux real) e\nincluso, vincula adecuadamente con la GPU (solo para\n<em>Microsoft Windows Insider Program</em> <a class=\"reference internal\" href=\"#cuda\" id=\"id2\"><span>[cuda]</span></a>) y permite hacer uso de Docker en Windows\nHome <a class=\"reference internal\" href=\"#docker\" id=\"id3\"><span>[docker]</span></a>.</p>", "a[href=\"#actualizar-a-wsl2\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Actualizar a WSL2<a class=\"headerlink\" href=\"#actualizar-a-wsl2\" title=\"Link to this heading\">#</a></h2><p>Si disponemos de un sistema de 64 bits (<em>x64</em>), podemos actualizar a WSL2\nsiempre y cuando la versi\u00f3n sea 1903 o superior, con n\u00famero de compilaci\u00f3n\n18362 o superior. Podemos verificar ejecutando <code class=\"code docutils literal notranslate\"><span class=\"pre\">winver</span></code> y verificar en\nla ventana que despliega.</p><p>En caso contrario, podemos recurrir al asistente de <em>Windows Update</em> para\ntener dicha versi\u00f3n. Una vez con este requisito, podemos ejecutar:</p>"}
skip_classes = ["headerlink", "sd-stretched-link"]

window.onload = function () {
    for (const [select, tip_html] of Object.entries(selector_to_html)) {
        const links = document.querySelectorAll(`article.bd-article ${select}`);
        for (const link of links) {
            if (skip_classes.some(c => link.classList.contains(c))) {
                continue;
            }

            tippy(link, {
                content: tip_html,
                allowHTML: true,
                arrow: true,
                placement: 'auto-start', maxWidth: 500, interactive: false,

            });
        };
    };
    console.log("tippy tips loaded!");
};
